double pyne::decay_const(int nuc)
{
  std::vector<double> result = data_access<double, level_data>(nuc, 0.0,
                               DBL_MAX, offsetof(level_data, half_life), level_data_lvl_map);
  if (result.size() == 1) {
    return log(2.0)/result[0];
  }
  return 0.0;
}


