double
Value::asDouble() const
{
  switch ( type_ ) {
  case nullValue:
    return 0.0;
  case intValue:
    return static_cast<double>( value_.int_ );
  case uintValue:
#if !defined(JSON_USE_INT64_DOUBLE_CONVERSION)
    return static_cast<double>( value_.uint_ );
#else // if !defined(JSON_USE_INT64_DOUBLE_CONVERSION)
    return static_cast<double>( Int(value_.uint_/2) ) * 2 + Int(value_.uint_ & 1);
#endif // if !defined(JSON_USE_INT64_DOUBLE_CONVERSION)
  case realValue:
    return value_.real_;
  case booleanValue:
    return value_.bool_ ? 1.0 : 0.0;
  case stringValue:
  case arrayValue:
  case objectValue:
    JSON_FAIL_MESSAGE( "Type is not convertible to double" );
  default:
    JSON_ASSERT_UNREACHABLE;
  }
  return 0; // unreachable;
}

float
Value::asFloat() const
{
  switch ( type_ ) {
  case nullValue:
    return 0.0f;
  case intValue:
    return static_cast<float>( value_.int_ );
  case uintValue:
#if !defined(JSON_USE_INT64_DOUBLE_CONVERSION)
    return static_cast<float>( value_.uint_ );
#else // if !defined(JSON_USE_INT64_DOUBLE_CONVERSION)
    return static_cast<float>( Int(value_.uint_/2) ) * 2 + Int(value_.uint_ & 1);
#endif // if !defined(JSON_USE_INT64_DOUBLE_CONVERSION)
  case realValue:
    return static_cast<float>( value_.real_ );
  case booleanValue:
    return value_.bool_ ? 1.0f : 0.0f;
  case stringValue:
  case arrayValue:
  case objectValue:
    JSON_FAIL_MESSAGE( "Type is not convertible to float" );
  default:
    JSON_ASSERT_UNREACHABLE;
  }
  return 0.0f; // unreachable;
}

bool
Value::asBool() const
{
  switch ( type_ ) {
  case nullValue:
    return false;
  case intValue:
  case uintValue:
    return value_.int_ != 0;
  case realValue:
    return value_.real_ != 0.0;
  case booleanValue:
    return value_.bool_;
  case stringValue:
    return value_.string_  &&  value_.string_[0] != 0;
  case arrayValue:
  case objectValue:
    return value_.map_->size() != 0;
  default:
    JSON_ASSERT_UNREACHABLE;
  }
  return false; // unreachable;
}


bool
Value::isConvertibleTo( ValueType other ) const
{
  switch ( type_ ) {
  case nullValue:
    return true;
  case intValue:
    return ( other == nullValue  &&  value_.int_ == 0 )
           || other == intValue
           || ( other == uintValue  && value_.int_ >= 0 )
           || other == realValue
           || other == stringValue
           || other == booleanValue;
  case uintValue:
    return ( other == nullValue  &&  value_.uint_ == 0 )
           || ( other == intValue  && value_.uint_ <= (unsigned)maxInt )
           || other == uintValue
           || other == realValue
           || other == stringValue
           || other == booleanValue;
  case realValue:
    return ( other == nullValue  &&  value_.real_ == 0.0 )
           || ( other == intValue  &&  value_.real_ >= minInt  &&  value_.real_ <= maxInt )
           || ( other == uintValue  &&  value_.real_ >= 0  &&  value_.real_ <= maxUInt )
           || other == realValue
           || other == stringValue
           || other == booleanValue;
  case booleanValue:
    return ( other == nullValue  &&  value_.bool_ == false )
           || other == intValue
           || other == uintValue
           || other == realValue
           || other == stringValue
           || other == booleanValue;
  case stringValue:
    return other == stringValue
           || ( other == nullValue  &&  (!value_.string_  ||  value_.string_[0] == 0) );
  case arrayValue:
    return other == arrayValue
           ||  ( other == nullValue  &&  value_.map_->size() == 0 );
  case objectValue:
    return other == objectValue
           ||  ( other == nullValue  &&  value_.map_->size() == 0 );
  default:
    JSON_ASSERT_UNREACHABLE;
  }
  return false; // unreachable;
}


/// Number of values in array or object
ArrayIndex
Value::size() const
{
  switch ( type_ ) {
  case nullValue:
  case intValue:
  case uintValue:
  case realValue:
  case booleanValue:
  case stringValue:
    return 0;
#ifndef JSON_VALUE_USE_INTERNAL_MAP
  case arrayValue:  // size of the array is highest index + 1
    if ( !value_.map_->empty() ) {
      ObjectValues::const_iterator itLast = value_.map_->end();
      --itLast;
      return (*itLast).first.index()+1;
    }
    return 0;
  case objectValue:
    return ArrayIndex( value_.map_->size() );
#else
  case arrayValue:
    return Int( value_.array_->size() );
  case objectValue:
    return Int( value_.map_->size() );
#endif
  default:
    JSON_ASSERT_UNREACHABLE;
  }
  return 0; // unreachable;
}


bool
Value::empty() const
{
  if ( isNull() || isArray() || isObject() )
    return size() == 0u;
  else
    return false;
}


bool
Value::operator!() const
{
  return isNull();
}


void
Value::clear()
{
  JSON_ASSERT( type_ == nullValue  ||  type_ == arrayValue  || type_ == objectValue );

  switch ( type_ ) {
#ifndef JSON_VALUE_USE_INTERNAL_MAP
  case arrayValue:
  case objectValue:
    value_.map_->clear();
    break;
#else
  case arrayValue:
    value_.array_->clear();
    break;
  case objectValue:
    value_.map_->clear();
    break;
#endif
  default:
    break;
  }
}

void
Value::resize( ArrayIndex newSize )
{
  JSON_ASSERT( type_ == nullValue  ||  type_ == arrayValue );
  if ( type_ == nullValue )
    *this = Value( arrayValue );
#ifndef JSON_VALUE_USE_INTERNAL_MAP
  ArrayIndex oldSize = size();
  if ( newSize == 0 )
    clear();
  else if ( newSize > oldSize )
    (*this)[ newSize - 1 ];
  else {
    for ( ArrayIndex index = newSize; index < oldSize; ++index ) {
      value_.map_->erase( index );
    }
    assert( size() == newSize );
  }
#else
  value_.array_->resize( newSize );
#endif
}


Value &
Value::operator[]( ArrayIndex index )
{
  JSON_ASSERT( type_ == nullValue  ||  type_ == arrayValue );
  if ( type_ == nullValue )
    *this = Value( arrayValue );
#ifndef JSON_VALUE_USE_INTERNAL_MAP
  CZString key( index );
  ObjectValues::iterator it = value_.map_->lower_bound( key );
  if ( it != value_.map_->end()  &&  (*it).first == key )
    return (*it).second;

  ObjectValues::value_type defaultValue( key, null );
  it = value_.map_->insert( it, defaultValue );
  return (*it).second;
#else
  return value_.array_->resolveReference( index );
#endif
}


Value &
Value::operator[]( int index )
{
  JSON_ASSERT( index >= 0 );
  return (*this)[ ArrayIndex(index) ];
}


const Value &
Value::operator[]( ArrayIndex index ) const
{
  JSON_ASSERT( type_ == nullValue  ||  type_ == arrayValue );
  if ( type_ == nullValue )
    return null;
#ifndef JSON_VALUE_USE_INTERNAL_MAP
  CZString key( index );
  ObjectValues::const_iterator it = value_.map_->find( key );
  if ( it == value_.map_->end() )
    return null;
  return (*it).second;
#else
  Value *value = value_.array_->find( index );
  return value ? *value : null;
#endif
}


const Value &
Value::operator[]( int index ) const
{
  JSON_ASSERT( index >= 0 );
  return (*this)[ ArrayIndex(index) ];
}


Value &
Value::operator[]( const char *key )
{
  return resolveReference( key, false );
}


Value &
Value::resolveReference( const char *key,
                         bool isStatic )
{
  JSON_ASSERT( type_ == nullValue  ||  type_ == objectValue );
  if ( type_ == nullValue )
    *this = Value( objectValue );
#ifndef JSON_VALUE_USE_INTERNAL_MAP
  CZString actualKey( key, isStatic ? CZString::noDuplication
                      : CZString::duplicateOnCopy );
  ObjectValues::iterator it = value_.map_->lower_bound( actualKey );
  if ( it != value_.map_->end()  &&  (*it).first == actualKey )
    return (*it).second;

  ObjectValues::value_type defaultValue( actualKey, null );
  it = value_.map_->insert( it, defaultValue );
  Value &value = (*it).second;
  return value;
#else
  return value_.map_->resolveReference( key, isStatic );
#endif
}


Value
Value::get( ArrayIndex index,
            const Value &defaultValue ) const
{
  const Value *value = &((*this)[index]);
  return value == &null ? defaultValue : *value;
}


bool
Value::isValidIndex( ArrayIndex index ) const
{
  return index < size();
}



